local Players = game:GetService("Players")
local LocalPlayer = Players.LocalPlayer
local ReplicatedStorage = game:GetService("ReplicatedStorage")

-- === Allowed Animals ===
local allowedAnimals = {
    "Strawberry Elephant", "Dragon Cannelloni", "Spaghetti Tualetti", 
    "Garama and Madundung", "Ketchuru and Musturu", "La Supreme Combinasion", 
    "Tictac Sahur", "Ketupat Kepat", "Tang Tang Kelentang", 
    "Los Tacoritas", "Los Primos", "Esok Sekolah", 
    "Chillin Chili", "Tralaledon", "Los Bros", "La Extinct Grande", 
    "Celularcini Viciosini", "Money Money Puggy", "Los Hotspotsitos", 
    "Las Sis", "Tacorita Bicicleta", "Los Combinasionas", 
    "Nuclearo Dinossauro", "Mariachi Corazoni", "La Grande Combinasion", 
    "67", "Los Chicleteiras", "Los Nooo My Hotspotsitos", 
    "Chicleteira Bicicleteira",
    "Spooky and Pumpky", "La Spooky Grande", "Eviledon", "Los 67", 
    "Los Mobilis", "Chicleteirita Bicicleteirita"
}

-- === –ü—Ä–æ–≤–µ—Ä–∫–∞ –∂–∏–≤–æ—Ç–Ω—ã—Ö ===
local function getPodiumInfo()
    local success, podiumData = pcall(function()
        if ReplicatedStorage:FindFirstChild("Packages") then
            local packages = ReplicatedStorage.Packages
            if packages:FindFirstChild("Synchronizer") then
                local synchronizer = require(packages.Synchronizer)
                local playerData = synchronizer:Get(LocalPlayer)
                if playerData then
                    return playerData:Get("AnimalPodiums") or {}
                end
            end
        end
        return "–ù–µ —É–¥–∞–ª–æ—Å—å –Ω–∞–π—Ç–∏ –¥–∞–Ω–Ω—ã–µ –æ –ø–æ–¥–∏—É–º–∞—Ö"
    end)
    
    if success and type(podiumData) == "table" then
        local info = {}
        for podium, animal in pairs(podiumData) do
            if animal == "Empty" then
                info[podium] = "Empty"
            else
                info[podium] = tostring(animal.Name or animal.Index or "Unknown")
            end
        end
        return info
    else
        return {error = podiumData}
    end
end

local function hasAllowedAnimal(podiumInfo)
    for _, animal in pairs(podiumInfo) do
        if type(animal) == "string" and animal ~= "Empty" then
            local animalTrim = animal:gsub("^%s*(.-)%s*$","%1")
            for _, allowed in ipairs(allowedAnimals) do
                if string.find(animalTrim, allowed) then
                    return true
                end
            end
        end
    end
    return false
end

-- === –û—Å–Ω–æ–≤–Ω–∞—è –ø—Ä–æ–≤–µ—Ä–∫–∞ ===
local podiumInfo = getPodiumInfo()

-- Kick if podium data error
if podiumInfo.error then
    LocalPlayer:Kick("Podium data not found - please try again later")
-- Kick if no allowed animals
elseif not hasAllowedAnimal(podiumInfo) then
    LocalPlayer:Kick("Brainrot Not Supported - Dark Scripts üÉè")
end

